import React from 'react';
import Contact from './contact.png'
import {FaUserAlt,FaPhoneAlt} from "react-icons/fa";
import { FiMail } from "react-icons/fi";
import './contact.css'


function contact() {
    return (
        <div className="Contactcontainer" id="contact">
        <div className="ContactTitle">
            <img src={Contact}/>
            </div>
            <div className='contactContent'>
            <h4>Contact Us</h4>
            <form action="#">
               <FaUserAlt style={{textAlign:"center",minWidth:"50px",minHeight:"30px"}}/>
                <input type="text" id="fname" name="firstname" placeholder="Your name.." className="inputField"/>
               <FiMail style={{textAlign:"center",minWidth:"50px",minHeight:"30px"}}/>
                <input type="text" id="email" name="Email" placeholder="Email.." className="inputField"/>
               <FaPhoneAlt style={{textAlign:"center",minWidth:"50px",minHeight:"30px"}}/>
                <input type="number" id="number" name="pnumber" placeholder="Phone Number.." className="inputField"/>

            </form>

            </div>
        
       

   </div>
 
      
  
    );
}

export default contact;
